      <link rel="canonical" href="https://www.oi.com.br/"/>
    </Head>
    Cidade:{cidade}
    <h1 className='title'>Bem vindo ao Projeto AMP_V1</h1>
    <ListadeRotas/>
  </div>
)}

export default Home
